import './Flight.css'
import Axios from "axios";

const Flight = () => {


  useEffect(() =>{
    Axios.get("http://localhost:3001/").then((Response)=> {
      console.log(Response);
    })
  
  },[]);

  return <div>
    <h1> Flights</h1>
   

  </div>
}

export default Flight
